import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';

import logo from './images/EZR.png';
import './App.css';

function App() {
  return (



      <AppBar position="static">  


            <img src={logo} className="App-logo" alt="logo" /> 

      </AppBar> 




  );
}

export default App;
